import React from 'react';

const menuList = [
  {
    index: '1',
    title: 'Profils & Technologies',
    image: <img src="/assets/persona.svg" alt="profil & technologies" />,
  },
  {
    index: '2',
    title: 'Expériences Professionnelles',
    image: '../assets/case.svg',
  },
  {
    index: '3',
    title: 'Projets',
    image: '../assets/notebook.svg',
  },
  {
    index: '4',
    title: 'Formations',
    image: '../assets/study.svg',
  },
  {
    index: '5',
    title: 'Compétences',
    image: '../assets/skill.svg',
  },
  {
    index: '6',
    title: 'Contacts',
    image: '../assets/message.svg',
  },
];

export default menuList;
